import React, { Component } from 'react'
import {Card, CardBody} from 'reactstrap';

export default class FloatWindow extends Component {
    render() {
        const { top, left } = this.props;
        return (
            <div style={{
                position : 'fixed',
                top,
                left,
                maxWidth : 250
            }} className="float-window">
                <Card>
                    <CardBody>
                        <p className="m-0">Test</p>
                    </CardBody>
                </Card>
            </div>
        )
    }
}
